// src/pages/LoginSignup.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { TextField, Button, Typography } from '@mui/material';

const LoginSignup = () => {
  const [isLogin, setIsLogin] = useState(true); // Toggle between login and sign up
  // Common fields for both modes
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  // Extra sign-up fields
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [pinCode, setPinCode] = useState('');
  const [location, setLocation] = useState('');
  const [stateName, setStateName] = useState('');
  const [phone, setPhone] = useState('');

  const [message, setMessage] = useState('');
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    setMessage('');

    // Simulate an API call delay for demonstration
    setTimeout(() => {
      if (isLogin) {
        setMessage('Login successful!');
        // After a successful login, redirect to the dashboard ("/")
        navigate('/');
      } else {
        setMessage('Sign up successful! Please log in.');
        // After sign up, switch to login mode (or redirect as needed)
        setIsLogin(true);
      }
    }, 1000);
  };

  return (
    <div style={styles.container}>
      <Typography variant="h4" gutterBottom>
        {isLogin ? 'Login' : 'Sign Up'}
      </Typography>
      <form onSubmit={handleSubmit} style={styles.form}>
        {/* Extra fields for sign up mode */}
        {!isLogin && (
          <>
            <TextField
              label="First Name"
              variant="outlined"
              type="text"
              value={firstName}
              onChange={(e) => setFirstName(e.target.value)}
              required
              style={styles.input}
            />
            <TextField
              label="Last Name"
              variant="outlined"
              type="text"
              value={lastName}
              onChange={(e) => setLastName(e.target.value)}
              required
              style={styles.input}
            />
          </>
        )}
        <TextField
          label="Email"
          variant="outlined"
          type="email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
          style={styles.input}
        />
        <TextField
          label="Password"
          variant="outlined"
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
          style={styles.input}
        />
        {/* Additional fields only for sign up */}
        {!isLogin && (
          <>
            <TextField
              label="PIN Code"
              variant="outlined"
              type="text"
              value={pinCode}
              onChange={(e) => setPinCode(e.target.value)}
              required
              style={styles.input}
            />
            <TextField
              label="Location"
              variant="outlined"
              type="text"
              value={location}
              onChange={(e) => setLocation(e.target.value)}
              required
              style={styles.input}
            />
            <TextField
              label="State"
              variant="outlined"
              type="text"
              value={stateName}
              onChange={(e) => setStateName(e.target.value)}
              required
              style={styles.input}
            />
            <TextField
              label="Phone Number"
              variant="outlined"
              type="tel"
              value={phone}
              onChange={(e) => setPhone(e.target.value)}
              required
              style={styles.input}
            />
          </>
        )}
        <Button variant="contained" color="primary" type="submit" style={styles.button}>
          {isLogin ? 'Login' : 'Sign Up'}
        </Button>
      </form>
      {message && (
        <Typography variant="body1" color="error" style={styles.message}>
          {message}
        </Typography>
      )}
      <Button
        onClick={() => {
          setIsLogin(!isLogin);
          setMessage('');
        }}
        style={styles.toggleButton}
      >
        {isLogin ? "Don't have an account? Sign Up" : "Already have an account? Login"}
      </Button>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '400px',
    margin: '50px auto',
    padding: '20px',
    textAlign: 'center',
    border: '1px solid #ccc',
    borderRadius: '8px',
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
    gap: '15px',
  },
  input: {
    width: '100%',
  },
  button: {
    marginTop: '10px',
  },
  toggleButton: {
    marginTop: '15px',
  },
  message: {
    marginTop: '10px',
  },
};

export default LoginSignup;
